import React from "react";

const ImgListItem01 = ({
  onClick,
  imgSrc,
  isLive,
  title,
  textPrimary,
  location,
}) => {
  return (
    <li className="item">
      <a onClick={onClick}>
        <div className="imgWrap">
          <img src={imgSrc} className="img-fluid" alt="" />
          {isLive && (
            <>
              <span className="play">
                <img src="/assets/img/svg/live-play.svg" alt="" />
              </span>
              <span className="play-live">LIVE</span>
            </>
          )}
        </div>
        <div className="InfoWrap">
          <h6>{title}</h6>
          <p>
            <strong className="text-primary">{textPrimary}</strong>
            {location}
          </p>
        </div>
      </a>
    </li>
  );
};

export default ImgListItem01;
